import React,{Component} from "react";

function Social(props){
    return(
        <ul>
         <li>
            <img src = {props.img} alt={`'icon of '${props.media}`}/>
         <input class="form-check-input mt-0 color=#198754 " 
         type="checkbox" id={props.id} value="Facebook" />
          <label htmlFor={props.id} class="px-2">{props.media}</label><br/>
        </li>
        </ul>
    );}

export default Social ;
